(1117, 235, 'about_text', '<h2>About Us</h2>\r\n                    <h1>Aquarium & Ponds</h1>\r\n                    <p>Ocean World Imports  is a Florida-based company that directly imports manufactured items from China and makes them available in the United States for competitive prices.  We specialize in selling a wide range of souvenirs and gifts, including glass, ceramic, and Polyresin items of all shapes and sizes.  Items can be printed on by Ocean World Imports to achieve a customized style that is more tailored to a particular geographical area.<br><br>Our company continuously adds new products every year to appeal to the ever changing tastes of consumers.  Additionally, we are always open to importing new items that are requested by our customers that we can reasonably order and obtain.  For all orders placed, we package, handle, and ship directly to you as soon as we can. </p>'),
