(7, 1, '2024-01-09 05:30:27', '2024-01-09 05:30:27', '<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<div class=\"form-inner mb-20\">\r\n<label>Full Name*</label>\r\n[text* yourname placeholder \"Jackson Mile\"]\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<div class=\"form-inner mb-20\">\r\n<label>Phone*</label>\r\n[tel* yourphone placeholder \"Ex- +880-13* ** ***\"]\r\n</div>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<div class=\"form-inner mb-20\">\r\n<label>Email <span>(Optional)</span></label>\r\n[email youremail placeholder \"Ex- info@gmail.com\"]\r\n</div>\r\n</div>\r\n<div class=\"col-md-12\">\r\n<div class=\"form-inner mb-20\">\r\n<label>Subject*</label>\r\n[text* yoursubject placeholder \"Subject\"]\r\n</div>\r\n</div>\r\n<div class=\"col-md-12\">\r\n<div class=\"form-inner mb-30\">\r\n<label>Short Notes*</label>\r\n[textarea* yourmessage placeholder \"Write Something...\"]\r\n</div>\r\n</div>\r\n<div class=\"col-md-12\">\r\n<div class=\"col-md-12\">\r\n<div class=\"form-inner\">\r\n[submit class:primary-btn1 class:hover-btn3 \"Submit now\"]\r\n</div>\r\n</div>\r\n</div>\r\n</div>\n1\n[_site_title] \"Another Enquiry for you\"\n[_site_title] <wordpress@dwstaging.link>\n[_site_admin_email]\nFrom: [yourname] [youremail]\r\nSubject: [yoursubject]\r\nMessage Body:\r\n[yourmessage]\r\nPhone number:\r\n[yourphone]\r\n\r\n\r\n-- \r\nThis is a notification that a contact form was submitted on your website ([_site_title] [_site_url]).\n\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <pushan.chakraborty@webart.technology>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis email is a receipt for your contact form submission on our website ([_site_title] [_site_url]) in which your email address was used. If that was not you, please ignore this message.\nReply-To: [_site_admin_email]\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an 