(360, 1, '2024-01-31 06:50:05', '2024-01-31 06:50:05', ' <p>Ocean World Imports  is a Florida-based company that directly imports manufactured items from China and makes them available in the United States for competitive prices.  We specialize in selling a wide range of souvenirs and gifts, including glass, ceramic, and Polyresin items of all shapes and sizes.  Items can be printed on by Ocean World Imports to achieve a customized style that is more tailored to a particular geographical area.</p>\r\n\r\n                <p>Our company continuously adds new products every year to appeal to the ever changing tastes of consumers.  Additionally, we are always open to importing new items that are requested by our customers that we can reasonably order and obtain.  For all orders placed, we package, handle, and ship directly to you as soon as we can. </p>\r\n\r\n                <p>How we are different: We are a family owned business and for that, we strive to establish relationships first then nurture them overtime.  It is our goal to maintain long lasting relationships with all our customers because we work from the heart first and believe the rest naturally falls into place. As a result of our philosophy, every step from the products we select to the tape we personally affix on a shipment box and everything in between is handled with the utmost attention to detail and fitted to the needs of each of our customers. </p>\r\n\r\n                <p>If you would like to receive our free catalog or place an order, please email Sales@oceanWorldimports.com and we will mail you a copy or discuss your order further.</p>', 'About Us', '', 'inherit', 'closed', 'closed', '', '21-revision-v1', '', '', '2024-01-31 06:50:05', '2024-01-31 06:50:05', '', 21, 'https://dwstaging.link/cms/allzay/?p=360', 0, 'revision', '', 0),
